import java.util.stream.Collectors;
import java.util.stream.IntStream;

public class DayFive {

    public String getResultingString(String input) {
        while (containsPair(input)) {
            for (int i = 0; i + 1 < input.length(); i++) {
                char a = input.charAt(i);
                char b = input.charAt(i + 1);
                if (Character.isUpperCase(a)) {
                    if (Character.isLowerCase(b) && Character.toLowerCase(a) == b) {
                        input = input.substring(0, i) + input.substring(i + 2);
                        break;
                    }
                } else if (Character.isLowerCase(a)) {
                    if (Character.isUpperCase(b) && Character.toLowerCase(b) == a) {
                        input = input.substring(0, i) + input.substring(i + 2);
                        break;
                    }
                }
            }
        }
        return input;
    }

    private boolean containsPair(String input) {
        char[] characters = input.toCharArray();
        for(int i = 0; i + 1 < characters.length; i++) {
            char a = characters[i];
            char b = characters[i + 1];
            if(Character.isUpperCase(a) && Character.isLowerCase(b) && (Character.toLowerCase(a) == b))
                return true;
            else if(Character.isLowerCase(a) && Character.isUpperCase(b) && (Character.toUpperCase(a) == b))
                return true;
        }
        return false;
    }

    private static final String input = "";

    public String getFullyReactedPolymer(String input, Character character) {
        input = input.replace(String.valueOf(Character.toUpperCase(character)), "");
        input = input.replace(String.valueOf(Character.toLowerCase(character)), "");
        return getResultingString(input);
    }

    public int getFullyReactedShortestPolymer(String input) {
        char[] characters = IntStream.rangeClosed('A', 'Z').mapToObj(c -> "" + (char) c).collect(Collectors.joining()).toCharArray();
        int shortestLength = Integer.MAX_VALUE;
        for(Character c : characters) {
            String temp = getFullyReactedPolymer(input, c);
            if (temp.length() < shortestLength)
                shortestLength = temp.length();
        }
        return shortestLength;
    }

    public static void main(String[] args) {
        DayFive dayFive = new DayFive();
        System.out.println(dayFive.getResultingString(input).length());
        System.out.println(dayFive.getFullyReactedShortestPolymer(input));
    }
}
